import React from 'react';
import '../../styles/portfolio.css';


const styles = {
  portfolioStyle: {
    background: 'red',
  },
  myPortfolioStyle: {
    fontSize: '100px',
  },
};

function portfolio() {
  return (
    <header style={styles.portfolioStyle} id="myPortfolio" className="portfolio">
      <h1 style={styles.myPortfolioStyle}>Portfolio</h1>
      <div className="applications-banner">
                    <figure className="figure">
                        <figcaption>Future Project</figcaption>
                        <a href="https://cobywalsh.github.io/Challenge-1/">
                        <img src="00870018 copy.jpg" alt="An image of a tree in the desert"/>
                        </a>
                    </figure>
                </div>
    </header>
  );
}

export default portfolio;
